from io import BytesIO
import matplotlib.pyplot as plt
import base64


def savefig():
    b = BytesIO()
    plt.savefig(b)
    return (
        '<img style="width:600px" src="data:image/png;base64,%s" />'
        % base64.b64encode(b.getvalue()).decode()
    )


